 public static final int maxOrder=80;
private	double [][][] theAbsWts=new double[2][][];
public	int [] theOrders =new int[2];
    public static double [][]   absWts(int order)  throws ProjectionRuntimeException
{
	if(order<0|| order > maxOrder)
	    {System.out.println("order should be >=2 less than "+ maxOrder);
		throw new ProjectionRuntimeException();}
	else {
	    return(allPairs[order-1]);}
    }
    public static double [][] []  absWts(int[] order)  throws ProjectionRuntimeException
    {double [][][]theRes=new double[2][][];
    	if(order[0]<0|| order[0] > maxOrder)
    	    {System.out.println("orders should be >=2 less than "+ maxOrder);
    		throw new ProjectionRuntimeException();}
    	else {if(order.length>1){
        	if(order[1]<0|| order[1] > maxOrder)
    	    {System.out.println("orders should be >=2 less than "+ maxOrder);
    		throw new ProjectionRuntimeException();}}
    		theRes[0]=allPairs[order[0]-1];
    		if(order.length>1)theRes[1]=allPairs[order[1]-1];
    	    return(theRes);}
        }
	public GaussHermite() {
		super();
	}
    public  GaussHermite(int nn) throws ProjectionRuntimeException{
	theAbsWts[0]=absWts(nn);
	theOrders[0]=nn;
    }
    public  GaussHermite(int[] nn) throws ProjectionRuntimeException{
    	theAbsWts=absWts(nn);
    	theOrders=nn;
        }
    public static double[][]computeRanges(double[]shockMeans,double[]shockVariances,int [] shockOrders){
    	int ii;int numShocks=shockMeans.length;double[][] theRes=new double[numShocks][];
    	for(ii=0;ii<numShocks;ii++){
    		theRes[ii]=computeARange(shockMeans[ii],shockVariances[ii],shockOrders[ii]);
    	}
    	return( theRes);
    }
    public static double[] computeARange(double shockMean,double shockVariance,int shockOrder){
    	double[] theRes= new double[2];
    	theRes[0]=sqrt2*shockVariance*allPairs[shockOrder-1][0][0]+shockMean;
       	theRes[1]=sqrt2*shockVariance*allPairs[shockOrder-1][shockOrder-1][0]+shockMean;
    	return(theRes);
    }
    
    
    
public double integrate(ScalarFunction ff) throws ProjectionRuntimeException  {
    return(integrate(ff,0,1));
}
    public double integrate(ScalarFunction ff, 
			    double theMean, double theStDev) throws ProjectionRuntimeException {
    int ii1;double [] epsVec=new double [2];
    double theRes=0;double sigFac=sqrt2*theStDev;
    for(ii1=0;ii1<theOrders[0];ii1++) {
 
        	epsVec[0]=this.theAbsWts[0][ii1][0]*sigFac+theMean;
	theRes+=
	    this.theAbsWts[0][ii1][1]*
	    ff.evaluate(epsVec[0]);	
    }
    if(theOrders[0]>0) theRes=piFactor*theRes;
    return(theRes);
    }

public EquationValDrv integrate(Integrand ff,StochasticBasis theProj) throws ProjectionRuntimeException {
	if(theProj.isPerfectForesightQ()){return(ff.evaluate(new double[ff.epsDim()],theProj));} else {
    return(integrate(ff,theProj.getGaussHermiteMean(),theProj.getGaussHermiteStDev(),theProj));}
    }
    public EquationValDrv integrate(Integrand ff, 
			      double[] theMean, double[] theStDev,
			      StochasticBasis theProj) throws ProjectionRuntimeException {
    	if(theProj.isPerfectForesightQ()){return(ff.evaluate(new double[ff.epsDim()],theProj));} else {

    int ii1,ii2;double [] epsVec= new double[ff.epsDim()];
    EquationValDrv theRes=ff.evaluate(epsVec,theProj).times(0);/*get a zero of appropriate dimensions*/
   double[] sigFac={sqrt2*theStDev[0],0};
   
    double wtProd;
 int innerItLim=1;
 if(theOrders.length>1){
	 innerItLim=theOrders[1];
	 sigFac[1]=sqrt2*theStDev[1];
 }
    for(ii1=0;ii1<theOrders[0];ii1++) {
        for(ii2=0;ii2<innerItLim;ii2++) {
        	wtProd=1;
        	 if(theOrders[0]>0)wtProd=wtProd*this.theAbsWts[0][ii1][1];
     	    if(theOrders[0]>0)epsVec[0]=(this.theAbsWts[0][ii1][0]*sigFac[0]+theMean[0]);
        	 if(theOrders.length>1) {   if(theOrders[1]>0)wtProd=wtProd*this.theAbsWts[1][ii2][1];
      if(theOrders[1]>0)epsVec[1]=(this.theAbsWts[1][ii2][0]*sigFac[1]+theMean[1]);}
	    theProj.setInNeedOfShockUpdatesQ(false);//theProj.isPerfectForesightQ()=true;
	    ff.setShocks(theProj,epsVec);	
	    theProj.setInNeedOfShockUpdatesQ(true);//theProj.isPerfectForesightQ()=false;
	
	    theRes=theRes.plus(
	   ff.evaluate(epsVec,theProj).times(wtProd));	
    }}
	
    if(theOrders[0]>0)theRes=theRes.times(piFactor);
    if(theOrders.length>1)if(theOrders[1]>0)theRes=theRes.times(piFactor);
    return(theRes);}
}
